Background colour of body and tail of living specimens (stage 30 and 36) semi-transparent dark-brown with irregular white spot, slightly lighter on rostral appendage; a conspicuous pattern of dark brown and gold or orange brown pigmentation on dorsum of body and half of tail, particularly on dorsal part of head and trunk reaching laterally below eye; a shiny lateral stripe from base of oral umbeliform to pre-orbital below nares and border between rostral and rostral appendage; black eye sclera, iris dominated with gold brown with sprinkle dark spot, pupil rounded homogenously black; a pale stripe below spiracle; tail and fin laterally covered by a marbled pattern of dark brown pigmentation (
Fig. 8A
); edges of upper and lower fins with golden iridophores, smaller on lower fin; in preserved specimens, the dark patterns fade and the skin turn transparent, and the orange gold pigmentation become pale whitish.

In the beginning of rainy season (
September 2018
), when the forest floor was still dry, the call of males was heard at sunset (18:00–18:30). But, this call also could be heard at midnight and even in the daytime at the end of the rainy season (
March 2019
), especially during the light rain or after a heavy rain. The inguinal amplexus individuals were observed in the waterfall at 16:00 on 
15 March 2019
after a heavy rain between 12:00–15:00 (
Fig. 10
). We found that they were mobile, sometimes submerged among the rock under the current at the shore of waterfall, about 
10 m
from the waterfall. Other ecological and biological information (e.g. populations, distributions, habitat requirements etc.) of the new species is unknown. The following anuran species have been found sympatrically with the new species. At the Meratus Mountain range: 

